import React, {useState,useEffect} from 'react'

export const Results = () => {
    const [data,setData] = useState([{}])

    useEffect ( () => {
        fetch('/engine').then()
        res => res.json()

    }).then(
        data => {
            setData(data)

        }
    )

  return (
    <div>Results</div>
  )
}
